import React, { useState } from "react";

const NextPages = () => {
  const pageNumber = 0;

  return (
    <div className="pages-container">
      <i
        class="fa-solid fa-chevron-left"
        onClick={() => {
          if (pageNumber > 0) {
            pageNumber--;
          } else {
            null;
          }
        }}
      ></i>
      <i class="fa-solid fa-chevron-right"></i>
    </div>
  );
};

export default NextPages;
